function process() {
    $('#verify').css({
        display: "none"
    });
    $('#LTContent').css({
        display: "none"
    });
    $('#ten_list').css({
        display: "none"
    });
    $('#processrent').css({
        display: 'block'
    });
    $('#tendet').css({
        display: 'none'
    });
    $('#processrent').load('/includes/man/payrent.php')
}

$('.nav-link').on('click', (e) => {
    $('#verify').hide()
    $('#LTContent').hide()
    $('#ten_list').hide()
    $('#tendet').hide()
})
tendet = () => {
    $('#ten_det').on('click', () => {
        $('#verify').css({
            display: "none"
        });
        $('#LTContent').css({
            display: "none"
        });
        $('#ten_list').css({
            display: "none"
        });
        $('#processrent').css({
            display: 'none'
        });
        $('#tendet').css({
            display: 'block'
        });
        $('#tendet').load('/actions/getTenantDetails.php')
    })
}